def modifyArray(nums, k, multiplier):
    for _ in range(k):
        min_val = min(nums)
        idx = nums.index(min_val)
        nums[idx] = min_val * multiplier
    return nums

def kth_character(k):
    word = "a"
    while len(word) < k:
        word += "".join(chr((ord(char) - ord('a') + 1) % 26 + ord('a')) for char in word)
    return word[k-1]

