def main():
    import sys
    input = sys.stdin.read
    data = input().split()
    N = int(data[0])
    strings = data[1:N+1]
    max_length = max(len(s) for s in strings)
    result = [''] * max_length
    for i in range(max_length):
        for j in range(N-1, -1, -1):
            if i < len(strings[j]):
                result[i] += strings[j][i]
            else:
                result[i] += '*'
    for line in result:
        print(line)
main()

